applist.Overview:
MotionEye Docker&lt;br /&gt;
A surveillance solution base on: MotionEye, Motion and Docker.&lt;br /&gt;
&lt;br /&gt;
It's easy and ready to use. Just configure a camera and run this docker, then videos and images will be saved once a motion is detected while a notification e-mail including the recorded video and a preview image will be sent. On top of that, the webcam can be accessed anytime via HTTP live streaming.&lt;br /&gt;
&lt;br /&gt;
Default Username: admin&lt;br /&gt;
Default Password: BLANK&lt;br /&gt;
&lt;br/&gt;
Root Directory "/var/lib/motioneye/

&lt;b&gt;Docker-UniFi-Video&lt;/b&gt;&lt;br /&gt;
&lt;br /&gt;
    Port - Type (TCP/UDP) - Purpose&lt;br /&gt;
     7022 - TCP - SSH (NVR Side)&lt;br /&gt;
     6666 - TCP - Inbound Camera Streams (NVR Side)&lt;br /&gt;
     7004 - UDP - UVC-Micro Talkback (Camera Side)&lt;br /&gt;
     7080 - TCP - HTTP Web UI &amp; API (NVR Side)&lt;br /&gt;
     7442 - TCP - Camera Management (NVR Side)&lt;br /&gt;
     7443 - TCP - HTTPS Web UI &amp; API (NVR Side)&lt;br /&gt;
     7445 - TCP - Video over HTTP&lt;br /&gt;
     7446 - TCP - Video over HTTPS&lt;br /&gt;
     7447 - TCP - RTSP via the controller&lt;br /&gt;

